pull_request.body:
Allows use of mutation schema and resolvers through the same interface as the previous GQL module. 
The exported class from entry file now has a class method called 'mutate' which can be used for accessing mutations. 

Some minor refactor conducted as well. 

Usage example:
`
const l = new LivingTrello(MY_KEY, MY_TOKEN)
l.mutate(`
  {
    getList(byId:MY_LIST_ID) {
      card1: addCard(withName: "Hello world") {
        id
        name
      }
      card2: addCard(withName: "Hello world2") {
        id
        name
      }
    }
  }
`).then(console.log).catch(console.log)

`
